import React from 'react'
import "./Filter.css"
import CheckBoxComponent from './CheckBoxComponent'

export default function Filter() {

  const FilterList = [
    {
      gender: ['male', 'female'],
    },
    {
      category: ['ST', 'SC'],
    }
  ];
  

  return (
    <div className='mainFilterDiv'>
      <div className='filterDiv1'>
        <h2 className='mainFilterHeading'>Filters</h2>
        <button className='resetFilterButton'>Reset Filters</button>
      </div>

      {FilterList.map((item, key) => {
      <div className='filterDivs'>
        <span>{item}</span>
        {/* <CheckBoxComponent className='checkboxComponents' value="All" />
        <CheckBoxComponent className='checkboxComponents' value="Male" />
        <CheckBoxComponent className='checkboxComponents' value="Female" />
        <CheckBoxComponent className='checkboxComponents' value="Transgender" /> */}
      </div>
      })}


      // <div className='filterDivs'>
      //   <span>Gender</span>
      //   <CheckBoxComponent className='checkboxComponents' value="All" />
