      //   <CheckBoxComponent className='checkboxComponents' value="Urban" />
      // </div>
      // <div className='filterDivs'>
      //   <span className='filterCategoryName'>Minority</span>
      //   <CheckBoxComponent className='checkboxComponents' value="No" />
      //   <CheckBoxComponent className='checkboxComponents' value="Yes" />
      // </div>
      // <div className='filterDivs'>
      //   <span className='filterCategoryName'>Disability</span>
